import React, { Component } from 'react'
import Table from '../table'

export default class Home extends Component {
    
    render() {
        return (
            <div style={bodyStyle}>
            <h2 style={titleStyle}>Recently Added</h2>
            <Table data = {this.state.data}/>
        </div>
        )
    }
}

const bodyStyle = {
};

const titleStyle = {
    textAlign:'center',
    color:'#3d3d3d',
    marginTop:'30px'

};
